import './Header.css';

function Header(){
    return(
        <div className='App-Bar'>
              <img className="Logo"  src="img/logo.png" />
              <div className='Menu'>
                <p id='Home'>HOME</p>
                <p>Prologue</p>
                <p>ALL COOKIES</p>
                <p>CookieDog Team</p>
                <p>Opensea</p>
              </div>
              <div className='Connect-Wallet-Button'>connect wallet</div>
            </div>
    )
}

export default Header;
